// src/components/Navbar.js
import React from 'react';
import { Link } from 'react-scroll';
import './Navbar.css';

const Navbar = () => {
  return (
    <nav className="navbar">
      <ul className="navbar-links">
        <li>
          <Link
            to="hero"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            offset={-80} // Adjust this value if scrolling is inaccurate
          >
            Home
          </Link>
        </li>
        <li>
          <Link to="bio" smooth={true} duration={500} spy={true} activeClass="active" offset={-150}>Bio</Link>

        </li>
        <li>
          <Link
            to="experience"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            offset={-80}
          >
            Experience
          </Link>
        </li>
        <li>
          <Link
            to="projects"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            offset={-80}
          >
            Projects
          </Link>
        </li>
        <li>
          <Link
            to="contact"
            smooth={true}
            duration={500}
            spy={true}
            activeClass="active"
            offset={-80}
          >
            Contact
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
